import React, { Component } from "react";
import Slider from 'infinite-react-carousel';

export class ImageSlider extends Component {
    render() {
        console.log("this.props.data",this.props.data. this.props.data.slides)
        return (
            <Slider dots>
                <div className="row">
                    {this.props.data &&  this.props.data.slides
                        ? this.props.data.slides.map((imageObject) => (
                            <div key={imageObject.imgindex}>
                                <img src={imageObject.imgurl} />
                            </div>
                        ))
                        : "loading"}
                </div>
            </Slider>
        );
    }
}
export default ImageSlider;
